    - type: Paper
      content: >
        Знаешь, а работа связиста не так плоха, как я думал. Полагал, что уже нигде не найду работу, но тут-мне пришло письмо, и я уже принят! Мне даже выдали небольшой офис в штабе. Единственное, что странно-консоль просмотра камер. Вернар, наш директор, сказал, что это от прошлого смотрителя, и что мне не стоит обращать на это внимание.


        Тут есть и другие приятные личности, например-Карл, заместитель нашего главтеха, он работает на ресепшене и часто дает мне бесплатную пиццу после смены, каждый раз оправдываясь тем, что "он не смог это продать". Надеюсь, у него не будет неприятностей из-за меня.


        Так-же могу упомянуть Роберта-нашего уборщика, который стал местной легендой. Иногда такое ощущение, будто он-призрак, его никто не видит, но Бастилия почти всегда вылизана до блеска! Мне довелось с ним встретиться, когда он убирался в коридоре. Оказалось, что он, пускай и немного ворчливый и назойливый, но все-же добрый старик. Он рассказал мне, что работает здесь уже 50 лет, я, конечно, не особо верю ему.


        Пожалуй, об остальных расскажу позже, сейчас мне звонит очередной клиент. Люблю тебя, мам ;)
