    - type: Paper
      content: >-
        Я все понимаю, "мы можем себе позволить" и все в этом роде, но... Зачем ремонтному цеху СТОЛЬКО масла? Последнее время бочки с маслом забили все склады, и пришлось расставлять их в коридорах. Причем если-бы они хотя-бы прибывали в нормальном состоянии... Но нет-буквально вчера при разгрузке одна из бочек упала на одного из грузчиков! Эта огромная лужа масла до сих пор покрывает весь пол. У нас вообще есть уборщик?! Где этот чертов Роберт когда он так нужен?!


        Я понятия не имею, откуда у Хофмана берутся средства на закупку столь обширных запасов масла, когда он даже нормальные обеды нам обеспечить не может! Этот человек странный. В плохом смысле, странный.


        Однако, больше всего меня смущает то, что к нам очень часто стал заглядывать Норман, и забирать все эти бочки... Хотя, Норман является нашим единственным поставщиком и его-же ребята нам их привозят. Мне что-то подсказывает, что дело пахнет жареным... маслом
