    - type: Paper
      content: >-
        Вы уверены, что введение в эксплуатацию жило-торгового и плазма-добывающего корпуса было хорошей идеей? Последние семь лет моей работы эта платформа только и делает, что идет ко дну! Мы ведь и так концы-с-концами еле как сводим-даже недавно пришлось переоборудовать утилизаторскую под цех переработки мусора! Так вот, возвращаясь к этой "хорошей идее" от Вернара в виде новых двух корпусов. Я ведь заведую производством, и меня не обмануть фальшивой бухгалтерией: Платформа потребляет колоссальное количество энергии для работы, а взамен мы получаем не так что-бы много плазмы! Одна радость-этого "не так что-бы много" хватает для запитки остальной электросети, так что в поставках от Нормана, мы, слава богу не нуждаемся (а с его-то завышенными ценами-и подавно). 


        Я не уверен, что еще долго проработаю здесь. Это место меняет специальности как перчатки! Уже, как мне известно, трижды происходило увольнение почти всех сотрудников, последний раз это было три года назад, тогда это место было огромным ремонтным цехом. Но, после "смены направления", теперь это буровая вышка! Ох-х. Да, пожалуй, через неделю-другую я уволюсь... Однако, пропадать такой талантливый инженер как я не буду, мою кандидатуру уже рассмотрели на другой вышке, пускай там и довольно... необычный подход к найму рабочих, пока-что они отзываются положительно. Я надеюсь, что без меня здесь в первый-же день все не рухнет.
